import React from 'react'

const Alert = ({ text }) => {
    setTimeout(function () { document.querySelector('.alrt').innerHTML = ''; }, 5000);
    return (
        <div className='alert-container'>
            <div className='alert-inner'>
                {text}
                {text}
            </div>
        </div>
    )
}

export default Alert
